int calc(long long n, int i, int s)
{
	int k, a, b, c;
	long long n1;

	if (n & 1) return 0;
	if ((k = lookup(n)) > 0) { if (s+k > ans) ans = s+k; return 1; }
	if (n == 4) { if (s+2 > ans) ans = s+2; return 1; }
	if (n < 15) return 0;

	b = (int)sqrt((double)n);
	for ( ; p[i] <= b; i++) {
		if (!p[i]) continue;
		if (n % p[i]) continue;
		c = (int)p[i];
		n1 = n / c, a = 1;
		while (1) {
			if (n1 % c || n1 < c) break;
			n1 /= c, a++;
		}
		if (n1 == 1) { if (s+a > ans) ans = s+a; return 1; }
		if (n1 < c) n1 *= c, a--;
		while (a >= 0) {
			if (calc(n1, i+1, s+a)) return 1;
			n1 *= c, a--;
		}
	}
	return 0;
}
